import Offerings from "./Offerings";
import OfferCard from "./OfferCard";

function ProfileContainer({ user }) {
  return (
    <div className="user-container">
      {offerings.map((user) => (
        <div key={user.id}>
          <ProfileCard offer={user} />
        </div>
      ))}
    </div>
  );
}

export default OfferingsContainer;
